import React, {useState, useEffect} from 'react';
import {Navbar, Nav, Container, Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import styled from "styled-components";
import {useNavigate} from 'react-router-dom';
import logo from '../imgs/logo.png';

const Navigate = () => {
    const navigate = useNavigate();

    const MainButton = () => {      //로고 클릭시 메인페이지 이동
        navigate("/");
    }

    const handleLogin = () => {
        navigate("/login")
    };

    const handleSignUp = () => {
        navigate("/register")
    };

    return (
        <TopNav>
            <Navbar style={{
                position: "fixed",
                backgroundColor: "gray",
                boxShadow: "1.5px 1.5px 1.5px 1.5px #F3F4F6",
                width: "100%",
                zIndex: "1000"
            }}>
                <Navbar.Brand>
                    <Nav_Str>
                        <UserImg onClick={MainButton}>
                            <img className="logoImage" alt="Logo" src={logo}/>
                        </UserImg>
                        <Button color="inherit" variant="light" onClick={handleLogin}
                                style={{marginRight: '0.5rem'}}>로그인</Button>
                        <Button color="inherit" variant="light" onClick={handleSignUp}>회원가입</Button>
                    </Nav_Str>
                </Navbar.Brand>
            </Navbar>
        </TopNav>
    )
}

const TopNav = styled.div`
  height: 10vh;
  background-color: yellow;

`

const UserImg = styled.button`
  background: none;
  border: none;
  position: relative;
  left: 2rem;

  img {
    width: 2px;
  }
`;

const Nav_Str = styled.div`
  display: flex;
  flex-direction: row;
  width: 100vw;
  align-items: center;

`

export default Navigate;
